import {News} from '../../data/carousel.js'



const Carousel = () => {
    const IMG = (imgName) => {
        return require(`../assets/${News.image}`)
    }



    return (
        <div>
            {News.map((slide,index) => {
                return(
                    <img src={IMG} alt='image'/>
                )
            })}
        </div>

    )
}
